    {
      "lineNumber": 101641,
      "originalJapaneseLine": "（あとこれ、",
      "translatedEnglishLine": "(And also this,"
    },
    {
      "lineNumber": 101642,
      "originalJapaneseLine": "　やっぱりラブレターですわよねぇ……）",
      "translatedEnglishLine": "　after all, it’s a love letter, isn’t it……)"
    },
    {
      "lineNumber": 101643,
      "originalJapaneseLine": "…………",
      "translatedEnglishLine": "…………"
    },
    {
      "lineNumber": 101644,
      "originalJapaneseLine": "……",
      "translatedEnglishLine": "……"
    },
    {
      "lineNumber": 101645,
      "originalJapaneseLine": "「おーい、アールコートちゃん、",
      "translatedEnglishLine": "\"Hey, Arcoate-chan,"
    },
    {
      "lineNumber": 101646,
      "originalJapaneseLine": "　なんか落としたぞー」",
      "translatedEnglishLine": "you dropped something—\""
    },
    {
      "lineNumber": 101647,
      "originalJapaneseLine": "「へ？」",
      "translatedEnglishLine": "\"Huh?\""
    },
    {
      "lineNumber": 101648,
      "originalJapaneseLine": "「なんだこれ？　手紙？」",
      "translatedEnglishLine": "\"What’s this? A letter?\""
    },
    {
      "lineNumber": 101649,
      "originalJapaneseLine": "「ひゃああああああああああ！？",
      "translatedEnglishLine": "\"Eeeeehhhhhh!?!?"
    },
    {
      "lineNumber": 101650,
      "originalJapaneseLine": "　すすすす、すみませんー！」",
      "translatedEnglishLine": "S-s-s-sorry!\""
    },
    {
      "lineNumber": 101651,
      "originalJapaneseLine": "「……ラブレター？」",
      "translatedEnglishLine": "\"...A love letter?\""
    },
    {
      "lineNumber": 101652,
      "originalJapaneseLine": "「ちちちち、違います！",
      "translatedEnglishLine": "\"N-n-no, it’s not that!"
    },
    {
      "lineNumber": 101653,
      "originalJapaneseLine": "　滅相もないです！」",
      "translatedEnglishLine": "Absolutely not!\""
    },
    {
      "lineNumber": 101654,
      "originalJapaneseLine": "「お、おう、何もそんな慌てることないだろう」",
      "translatedEnglishLine": "\"O-oh, no need to get so flustered.\""
    },
    {
      "lineNumber": 101655,
      "originalJapaneseLine": "「こ、これは……」",
      "translatedEnglishLine": "\"T-this is…\""
    },
    {
      "lineNumber": 101656,
      "originalJapaneseLine": "「ただのお守りです……",
      "translatedEnglishLine": "\"Just a good luck charm…"
    },
    {
      "lineNumber": 101657,
      "originalJapaneseLine": "　忘れないように持っていると、",
      "translatedEnglishLine": "I carry it so I don’t forget, and"
    },
    {
      "lineNumber": 101658,
      "originalJapaneseLine": "　なんだか強くなれる気がして、えへへ……」",
      "translatedEnglishLine": "somehow it makes me feel stronger, hehe…\""
    },
    {
      "lineNumber": 101659,
      "originalJapaneseLine": "「ふーん……？」",
      "translatedEnglishLine": "\"Hmm……?\""
    },
    {
      "lineNumber": 101660,
      "originalJapaneseLine": "結局、手紙は渡せないまま、",
      "translatedEnglishLine": "In the end, unable to hand over the letter,"
    },
    {
      "lineNumber": 101661,
      "originalJapaneseLine": "アールコートのお守りとして",
      "translatedEnglishLine": "it became Arcoate’s amulet"
    },
    {
      "lineNumber": 101662,
      "originalJapaneseLine": "肌身離さず持ち歩くことになった。",
      "translatedEnglishLine": "and she carried it close to her body at all times."
    },
    {
      "lineNumber": 101663,
      "originalJapaneseLine": "（でも……いつか……",
      "translatedEnglishLine": "(But… someday…"
    },
    {
      "lineNumber": 101664,
      "originalJapaneseLine": "　もっと私が強くなれたら……）",
      "translatedEnglishLine": "If I could become stronger…)"
    },
    {
      "lineNumber": 101665,
      "originalJapaneseLine": "（………………いつか、きっと……）",
      "translatedEnglishLine": "(……Someday, surely……)"
    },
    {
      "lineNumber": 101666,
      "originalJapaneseLine": "「お、アールコートちゃん」",
      "translatedEnglishLine": "\"O-hey, Arcoate-chan\""
    },
    {
      "lineNumber": 101667,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"……\""
    },
    {
      "lineNumber": 101668,
      "originalJapaneseLine": "「あ、あれ？」",
      "translatedEnglishLine": "\"H-Huh?\""
    },
    {
      "lineNumber": 101669,
      "originalJapaneseLine": "アールコートはランスに気づかず、",
      "translatedEnglishLine": "Arcoate didn’t notice Lance and"
    },
    {
      "lineNumber": 101670,
      "originalJapaneseLine": "すーっと去って行った。",
      "translatedEnglishLine": "quietly walked away."
    },
    {
      "lineNumber": 101671,
      "originalJapaneseLine": "「こら待て、無視するな」",
      "translatedEnglishLine": "\"Hey, wait, don’t ignore me!\""
    },
    {
      "lineNumber": 101672,
      "originalJapaneseLine": "「……へ？」",
      "translatedEnglishLine": "\"...Huh?\""
    },
    {
      "lineNumber": 101673,
      "originalJapaneseLine": "「あ……おじ様……」",
      "translatedEnglishLine": "\"Ah… Uncle…\""
    },
    {
      "lineNumber": 101674,
      "originalJapaneseLine": "「あ、おじ様って君……」",
      "translatedEnglishLine": "\"Ah, when you say ‘uncle’, you mean…\""
    },
    {
      "lineNumber": 101675,
      "originalJapaneseLine": "ボーッとした顔で、",
      "translatedEnglishLine": "With a dazed expression,"
    },
    {
      "lineNumber": 101676,
      "originalJapaneseLine": "アールコートはランスを見上げていた。",
      "translatedEnglishLine": "Arcoate looked up at Lance."
    },
    {
      "lineNumber": 101677,
      "originalJapaneseLine": "「どうかしたのか？",
      "translatedEnglishLine": "\"Is something wrong?"
    },
    {
      "lineNumber": 101678,
      "originalJapaneseLine": "　アールコートちゃんらしくないぞ。",
      "translatedEnglishLine": "This isn’t like you, Arcoate-chan."
    },
    {
      "lineNumber": 101679,
      "originalJapaneseLine": "　なんか悩み事か？」",
      "translatedEnglishLine": "Are you worried about something?\""
    },
    {
      "lineNumber": 101680,
      "originalJapaneseLine": "「あ、う……」",
      "translatedEnglishLine": "\"Ah, um…\""
    },
    {
      "lineNumber": 101681,
      "originalJapaneseLine": "ポロリと、アールコートの",
      "translatedEnglishLine": "Suddenly, from Arcoate’s"
    },
    {
      "lineNumber": 101682,
      "originalJapaneseLine": "大きな瞳から涙がこぼれた。",
      "translatedEnglishLine": "large eyes, tears spilled."
    },
    {
      "lineNumber": 101683,
      "originalJapaneseLine": "「うううううう〜〜〜……」",
      "translatedEnglishLine": "\"Uuuuuhhhhh……\""
    },
    {
      "lineNumber": 101684,
      "originalJapaneseLine": "「う、うわー！　突然泣くんじゃない！",
      "translatedEnglishLine": "\"W-whoa! Don’t start crying all of a sudden!"
    },
    {
      "lineNumber": 101685,
      "originalJapaneseLine": "　俺が泣かせたみたいじゃないか！」",
      "translatedEnglishLine": "It looks like I made you cry!\""
    },
    {
      "lineNumber": 101686,
      "originalJapaneseLine": "「ううううう〜〜〜！」",
      "translatedEnglishLine": "\"Uuuuuuuuuuuuu!\""
    },
    {
      "lineNumber": 101687,
      "originalJapaneseLine": "「え、ええい、向こうに行くぞ！",
      "translatedEnglishLine": "\"E-hey, let’s move over there!"
    },
    {
      "lineNumber": 101688,
      "originalJapaneseLine": "　ここじゃあ人目につく！」",
      "translatedEnglishLine": "Someone might see us here!\""
    },
    {
      "lineNumber": 101689,
      "originalJapaneseLine": "「ふう、ようやく泣き止んだか……」",
      "translatedEnglishLine": "\"Phew, finally stopped crying…\""
    },
    {
      "lineNumber": 101690,
      "originalJapaneseLine": "椅子に座らせ、",
      "translatedEnglishLine": "He sat her down in a chair,"
    },
    {
      "lineNumber": 101691,
      "originalJapaneseLine": "ランスが何度かなだめて、",
      "translatedEnglishLine": "and Lance calmed her down repeatedly,"
    },
    {
      "lineNumber": 101692,
      "originalJapaneseLine": "アールコートはようやく落ち着いた。",
      "translatedEnglishLine": "and Arcoate finally composed herself."
    },
    {
      "lineNumber": 101693,
      "originalJapaneseLine": "「ぐすっ……す、すみません……",
      "translatedEnglishLine": "\"Sniff… I-I'm sorry…"
    },
    {
      "lineNumber": 101694,
      "originalJapaneseLine": "　私、おじ様にご迷惑を……」",
      "translatedEnglishLine": "I caused you trouble, Uncle…\""
    },
    {
      "lineNumber": 101695,
      "originalJapaneseLine": "「いい、気にするな。",
      "translatedEnglishLine": "\"No, don’t worry about it."
    },
    {
      "lineNumber": 101696,
      "originalJapaneseLine": "　それより、何があったんだ？」",
      "translatedEnglishLine": "More importantly, what happened?\""
    },
    {
      "lineNumber": 101697,
      "originalJapaneseLine": "「うっ……それは、その……」",
      "translatedEnglishLine": "\"Ugh… well, it’s just that…\""
    },
    {
      "lineNumber": 101698,
      "originalJapaneseLine": "「言わないと、その……」",
      "translatedEnglishLine": "\"If I don’t say it, then…\""
    },
    {
      "lineNumber": 101699,
      "originalJapaneseLine": "「駄目だ。言え」",
      "translatedEnglishLine": "\"No, you have to say it.\""
    },
    {
      "lineNumber": 101700,
      "originalJapaneseLine": "「う……はい……」",
      "translatedEnglishLine": "\"Ugh… yes…\""
    }
  ]
}

